(1,'Carcinoma','A carcinoma begins in the skin or the tissue that covers the surface of internal organs and glands. Carcinomas usually form solid tumors. They are the most common type of cancer. Examples of carcinomas include prostate cancer, breast cancer, lung cancer, and colorectal cancer.','https://storage.cloud.google.com/disease-images/carcinoma_1.jpg?authuser=1','2021-01-25 15:15:33.107895','2021-04-15 16:50:13.289942','carcinoma'),
(2,'Pigmented','Pigmented BCC is a variant which shows increased melanin pigments which are produced by benign melanocytes that colonize the tumour. Differential diagnosis for pigmented BCC include, pigmented naevi, melanoma, pigmented seborrheic keratosis and pigmented Bowen\'s disease.','https://storage.cloud.google.com/disease-images/pigmented_1.jpg?authuser=1','2021-01-25 15:15:45.844847','2021-04-15 17:01:39.802972','pigmented'),
(3,'Normal','Not too dry and not too oily, normal skin has: No or few imperfections. No severe sensitivity. Barely visible pores. A radiant complexion.',NULL,'2021-01-25 15:15:57.220146','2021-03-08 08:38:00.993959','normal'),
(4,'Melanoma','Melanoma is a form of skin cancer that begins in the cells (melanocytes) that control the pigment in your skin. This illustration shows melanoma cells extending from the surface of the skin into the deeper skin layers.','https://storage.cloud.google.com/disease-images/melanoma_1.jpg?authuser=1','2021-01-25 15:16:08.945909','2021-04-15 17:01:40.623257','melanoma');
