(1,'Science News','People with rare blood clots after a COVID-19 jab share an uncommon immune response','Evidence is building that an uncommon immune response is behind dangerous, but incredibly rare, blood clots associated with some COVID-19 vaccines. But the good news is that there is a test doctors can use to identify it and get patients the right care.\r\n\r\nA small number of people out of the millions vaccinated with AstraZeneca’s or Johnson & Johnson’s COVID-19 shots have developed severe blood clots, such as ones in the sinuses that drain blood from the brain (SN: 4/7/21; 4/13/21). A few have died.\r\n\r\nStudies suggest that some inoculated people develop an immune response that attacks a protein called platelet factor 4 or PF4, which makes platelets form clots. Those platelets get used up before the body can make more. So these patients wind up with both the rare clots and low levels of blood platelets.','https://www.sciencenews.org/wp-content/uploads/2021/04/041621_eg_bloodclot_feat-1380x776.jpg','2021-03-08 09:30:24.886631','2021-04-17 02:28:50.374612',1),
(2,'Oncology & Cancer','Breast cancer death rates stop declining in younger women','Breast cancer death rates have stopped declining for women in the U.S. younger than age 40, ending a trend that existed from 1987 to 2010, according to a new study in Radiology. Researchers expressed hope that the findings would raise awareness of breast cancer in younger women and spur research into the causes behind the change.\r\nStatistics have shown steady decline in overall breast cancer mortality rates for American women since 1989. From 1989 to 2017, breast cancer mortality rates for all women in the U.S. decreased by 40%, a decrease attributed to improved treatment and increased rates of screening mammography use starting in the early to mid-1980s.\r\nIn the new study, researchers determined U.S. trends in female breast cancer mortality rates by 10-year age subgroups based on recent data from the National Center for Health Statistics.\r\nAnalysis showed that from 2010 to 2017, mortality rates decreased between 1.2% and 2.2% per year for women in each age decade from 40 to 79 years but increased by a non-significant 0.5% per year for women 20 to 39 years of age.\r\nThe changing mortality rate in younger women is likely related to an increase in distant-stage, or metastatic, breast cancers. The authors\' analysis of invasive breast cancer incidence rates from the Surveillance, Epidemiology, and End Results program found that distant-stage breast cancer incidence rates have increased by over 4% per year since the year 2000 in women ages 20 to 39 years, a much higher rate of increase than in women ages 40 and over.','http://press.rsna.org/pressrelease/2021_resources/2247/hendrick_hs-sm.jpg','2021-03-08 09:34:31.096411','2021-04-17 02:37:12.704336',1),
(3,'Nomogram Developed to Guide Management of Thin Melanomas','The researchers tested the nomogram in a development set consisting of a Dutch cohort of 25,930 patients and validated the risk prediction tool in an Australian cohort of 2968 patients. Multivariable Cox models were generated for local, regional, and distant recurrence-free survival.','n the development model, C-statistics of 0.79, 0.77, and 0.80 were found for local recurrence-free survival, regional recurrence-free survival, and distant recurrence-free survival, respectively. In the validation model, these C-statistics were 0.80, 0.76, and 0.74, respectively.\r\nThe current staging system considers only T-stage and sentinel node status to predict survival in T1 melanoma, the researchers noted.\r\n“We found that the predictive performance for [local recurrence-free survival, regional recurrence-free survival, and distant recurrence-free survival](indicated by the C-statistic) increased from 0.67, 0.68, and 0.70, respectively, for the model including T-stage and SN status to 0.79, 0.77, and 0.80, respectively, by using the current nomogram for the development cohort, and from 0.65, 0.66, and 0.65, respectively, to 0.80, 0.76, and 0.74, respectively, for the validation cohort,” they wrote.\r\nThis newly developed nomogram will “assist in the planning of appropriate follow-up schedules and determining clinical trial eligibility and stratification.”','https://www.cancertherapyadvisor.com/wp-content/uploads/sites/12/2020/02/doctor-patient-research_G_1137444439-1024x682.jpg','2021-03-08 09:42:22.420130','2021-04-17 02:36:37.196106',1),
(4,'Health & Medicine','A trick from cancer cells helps rats accept transplanted limbs','Microparticles that release a signaling protein normally secreted from cancer cells to hide from the immune system helped white Lewis rats that received donor legs from brown Norway rats tolerate the transplanted limbs.','https://www.sciencenews.org/wp-content/uploads/2020/03/031220_eg_tcells_feat.jpg','2021-04-17 02:40:15.138909','2021-04-17 02:40:15.138909',1);
